import React, { useState } from 'react';
import './FacultyDashboard.css'; // Add a CSS file for styling

const FacultyDashboard = () => {
  // You can dynamically fetch this data from an API or database later
  const facultyInfo = {
    name: "Dr. John Doe",
    dob: "April 12, 1980",
    degree: "PhD in Computer Science",
    specialization: "Artificial Intelligence",
    contact: "john.doe@university.edu",
    image: "/images/faculty.jpg", // Image path
  };

  // State to handle attendance form
  const [attendance, setAttendance] = useState({
    username: '',
    date: '',
    status: 'Present', // Default status
  });

  // State to toggle attendance form visibility
  const [showForm, setShowForm] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setAttendance((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Attendance submitted:", attendance);

    // Here you can add the logic to save the attendance data to a database or API

    // Clear the form after submission
    setAttendance({
      username: '',
      date: '',
      status: 'Present',
    });
    setShowForm(false); // Hide the form after submission
  };

  return (
    <div className="dashboard-container">
      <h2>Faculty Dashboard</h2>
      
      {/* Faculty Personal Information Section */}
      <div className="faculty-info">
        <img src={facultyInfo.image} alt="Faculty" className="faculty-image" />
        <div className="faculty-details">
          <h3>{facultyInfo.name}</h3>
          <p><strong>Date of Birth:</strong> {facultyInfo.dob}</p>
          <p><strong>Degree:</strong> {facultyInfo.degree}</p>
          <p><strong>Specialization:</strong> {facultyInfo.specialization}</p>
          <p><strong>Contact:</strong> {facultyInfo.contact}</p>
        </div>
      </div>

      {/* Faculty Dashboard Actions */}
      <div className="dashboard-actions">
        <button className="action-btn" onClick={() => setShowForm(!showForm)}>
          {showForm ? "Cancel" : "Add Attendance"}
        </button>
        <button className="action-btn">Fill Student Marks</button>
      </div>

      {/* Attendance Form */}
      {showForm && (
        <form className="attendance-form" onSubmit={handleSubmit}>
          <h3>Add Attendance</h3>
          <label htmlFor="username">Student Username:</label>
          <input
            type="text"
            id="username"
            name="username"
            value={attendance.username}
            onChange={handleChange}
            required
          />

          <label htmlFor="date">Date:</label>
          <input
            type="date"
            id="date"
            name="date"
            value={attendance.date}
            onChange={handleChange}
            required
          />

          <label htmlFor="status">Status:</label>
          <select
            id="status"
            name="status"
            value={attendance.status}
            onChange={handleChange}
          >
            <option value="Present">Present</option>
            <option value="Absent">Absent</option>
            <option value="Late">Late</option>
          </select>

          <button type="submit" className="submit-btn">Submit Attendance</button>
        </form>
      )}
    </div>
  );
};

export default FacultyDashboard;
